def scriptResult = ""

Transaction tx = persistence.createTransaction()
try {
    EntityManager em = persistence.getEntityManager()

    for (p in pets) {
        Pet pet = new Pet()
        pet.setId(UUID.fromString(p[0]))
        pet.setName(p[1])
        pet.setIdentificationNumber(p[2])
        pet.setOwner(em.find(Owner.class, UUID.fromString(p[3])))
        em.persist(pet)
    }

    scriptResult += 'Pets have been imported successfully\n'

    Calendar cal = Calendar.getInstance()
    Date today = cal.getTime()
    cal.add(Calendar.YEAR, -1)
    Date prevYear = cal.getTime()

    for (v in visits) {
        Visit visit = new Visit()
        visit.setId(UUID.fromString(v[0]))
        visit.setPet(em.find(Pet.class, UUID.fromString(v[1])))
        visit.setClinic(em.find(Clinic.class, UUID.fromString(v[2])))
        visit.setVisitDate(new Date(ThreadLocalRandom.current()
                .nextLong(prevYear.getTime(), today.getTime())))

        em.persist(visit)
    }

    scriptResult += 'Visits have been imported successfully\n'

    tx.commit()
} finally {
    tx.end()
}

return scriptResult
